S4343_3=(1/(4*pi))*(e31_m*(I1314_3+I2324_3)+e33_m*I3334_3-k33_m*I3344_3);
S_3(9,9)=S4343_3;
%
%% Calculations are based on the paper: Effective moduli of nanoparticle
% reinforced composites considering interphase effect by extended
% double-inclusion model - Theory and explicit expressions
% Pin Lu, Y. W. Leong, P. K. Pallahadka, C. B. He, International Journal of
% Engineering Science, volume 73, pp. 33 - 55 (2013)
%---------------------------Calculations-----------------------------------
%
E_p1 = zeros(9);
E_p2 = zeros(9);
E_p3 = zeros(9);
E_p1 = (inv(E_f - E_m))*E_m;
E_p2 = E_p1;
E_p3 = E_p1;
%
E_i1 = zeros(9);
E_i2 = zeros(9);
E_i3 = zeros(9);
E_i1 = (inv(E_i - E_m))*E_m;
E_i2 = E_i1;
E_i3 = E_i1;
%
phi_p1 = zeros(9);
phi_p1 = -(inv(S_1 + E_p1));
phi_p2 = zeros(9);
phi_p2 = -(inv(S_2 + E_p2));
phi_p3 = zeros(9);
phi_p3 = -(inv(S_3 + E_p3));
%
phi_i1 = zeros(9);
phi_i1 = -(inv(S_1 + E_i1));
phi_i2 = zeros(9);
phi_i2 = -(inv(S_2 + E_i2));
phi_i3 = zeros(9);
phi_i3 = -(inv(S_3 + E_i3));
%
A_i1_dil = zeros(9);
A_i1_dil = eye(9) + (S_1*phi_i1);
A_i2_dil = zeros(9);
A_i2_dil = eye(9) + (S_2*phi_i2);
A_i3_dil = zeros(9);
A_i3_dil = eye(9) + (S_3*phi_i3);
%
A_p1_dil = zeros(9);
A_p1_dil = eye(9) + (S_1*phi_p1);
A_p2_dil = zeros(9);
A_p2_dil = eye(9) + (S_2*phi_p2);
A_p3_dil = zeros(9);
A_p3_dil = eye(9) + (S_3*phi_p3);
%
for i = 1:1:length(vf_m)
    P = zeros(9);
    P =inv((vf_m(i)*eye(9)) + (vf_i1(i)*A_i1_dil) + (vf_p1(i)*A_p1_dil) + (vf_i2(i)*A_i2_dil) + (vf_p2(i)*A_p2_dil) + (vf_i3(i)*A_i3_dil) + (vf_p3(i)*A_p3_dil));
    %
    A_i1_g = zeros(9);
    A_i1_g = A_i1_dil*P;
    A_i2_g = zeros(9);
    A_i2_g = A_i2_dil*P;
    A_i3_g = zeros(9);
    A_i3_g = A_i3_dil*P;
    %
    A_p1_g = zeros(9);
    A_p1_g = A_p1_dil*P;
    A_p2_g = zeros(9);
    A_p2_g = A_p2_dil*P;
    A_p3_g = zeros(9);
    A_p3_g = A_p3_dil*P;
    %
    E_composite = E_m + (vf_i1(i)*(E_i - E_m)*A_i1_g) + (vf_p1(i)*(E_f -E_m)*A_p1_g) + (vf_i2(i)*(E_i - E_m)*A_i2_g) + (vf_p2(i)*(E_f -E_m)*A_p2_g) + (vf_i3(i)*(E_i - E_m)*A_i3_g) + (vf_p3(i)*(E_f -E_m)*A_p3_g);
    %
    %
    C11=E_composite(1,1);
    C12=E_composite(1,2);
    C13=E_composite(1,3);
    C21=E_composite(2,1);
    C22=E_composite(2,2);
    C23=E_composite(2,3);
    C31=E_composite(3,1);
    C32=E_composite(3,2);
    C33=E_composite(3,3);
    C44=E_composite(4,4);
    C55=E_composite(5,5);
    C66=E_composite(6,6);
    %
    e15=E_composite(7,5);
    e24=E_composite(8,4);
    e31=E_composite(9,1);
    e32=E_composite(9,2);
    e33=E_composite(9,3);
    Cmatrix(:,:)  = [C11 C12 C13 0 0 0;
        C21 C22 C23 0 0 0;
        C31 C32 C33 0 0 0;
        0 0 0 C44 0 0;
        0 0 0 0 C55 0;
        0 0 0 0 0 C66];
    Smatrix(:,:) = inv(Cmatrix(:,:));
    ematrix(:,:) = [0 0 0 0 e15 0;
        0 0 0 e24 0 0;
        e31 e32 e33 0 0 0];
    dmatrix(:,:) = ematrix(:,:)*Smatrix(:,:);
    E1_composite=(1/(Smatrix(1,1)));
    E2_composite=(1/(Smatrix(2,2)));
    E3_composite=(1/(Smatrix(3,3)));
    %
    G23=1/(Smatrix(4,4));
    G13=1/(Smatrix(5,5));
    G12=1/(Smatrix(6,6));
    %
    nu12=-(E1_composite*Smatrix(1,2));
    nu13=-(E1_composite*Smatrix(1,3));
    nu23=-(E2_composite*Smatrix(2,3));
    %
    k11=-E_composite(7,7);
    k22=-E_composite(8,8);
    k33=-E_composite(9,9);
    %
    d15=(dmatrix(1,5)/(1e-12))/(10^9);
    d24=(dmatrix(2,4)/(1e-12))/(10^9);
    d31=(dmatrix(3,1)/(1e-12))/(10^9);
    d32=(dmatrix(3,2)/(1e-12))/(10^9);
    d33=(dmatrix(3,3)/(1e-12))/(10^9);
    %
    fprintf(fileID1,'%f\t %f\t %f\t %f\t %f\t %f\t %f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\n', vf_p1(i), vf_p2(i), vf_p3(i), vf_i1(i), vf_i2(i), vf_i3(i), vf_m(i), E1_composite, E2_composite, E3_composite, G23, G13, G12, nu23, nu13, nu12, d31, d32, d33, d15, d24, k11,k22,k33);
    fprintf(fileID2,'%f\t %f\t %f\t %f\t %f\t %f\t %f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\t %12.20f\n', vf_p1(i), vf_p2(i), vf_p3(i), vf_i1(i), vf_i2(i), vf_i3(i), vf_m(i), C11, C12, C13, C22, C23, C33, C44, C55, C66, e31, e32, e33, e15, e24, k11,k22,k33);
    %
end
fclose(fileID1);
fclose(fileID2);